import axios from "axios";

export async function listPostData(id, status = "Waiting") {
  return axios
  .post(process.env.REACT_APP_BACKEND_PORT + "/api/post/listDetail", {
    post_category: selectCategory,
    user_id: initSession.user_id,
  })
}

export async function changePostStatus(id, status = "Waiting") {
  return axios.put(
    process.env.REACT_APP_BACKEND_PORT + "/api/post/changeStatus/" + id,
    {
      post_status: status,
    }
  );
}
